import React from "react";
import { Icon, Flex } from "@chakra-ui/core";

const Navigation = () => {
  return (
    <>
      <Flex
        py={4}
        px={[4, 4, 4, 8]}
        align="center"
        justify="space-between"
        backgroundColor="gray.900"
        borderRadius="md"
        mb={6}
      >
        <a href="/">
          <Icon name="Logo" color="white" h={10} w="auto" />
        </a>
      </Flex>
    </>
  );
};

export default Navigation;
